import React from 'react';

class Input extends React.Component {
	constructor(props) {
		super(props);
		this.input = React.createRef();
	}


	renderInput() {
		return <input type="text" value={1} />;
	}

	render() {
		return (
			<div>
				<form className="ui form">
					<div className="field">
						{this.renderInput()}
						alert({this.props.valueone})
					</div>
				</form>
			</div>
		);
	}
}

export default Input;
